import Signin from './UserRegistration/SignIn';
import Signup from './UserRegistration/SignUp';

function App() {
  return (
    <div className="w-full h-full">

      <Routes>
        <Route path="/" element={<Signup />} />
        <Route path="/signin" element={<Signin />} />
      </Routes>

    </div>
  );
}

export default App;
